import { useState, useEffect } from "react";
import axios from "axios";

const App = (props) => {
  const [state, setState] = useState("Hi There");
  const [ddlTeams, setddlTeams] = useState([]);

  const clickHandeler = () => {
    axios.get("/getData").then((res) => {
      setState(res.data[0].player_name);
    });
  };

  useEffect(() => {
    async function getTeams() {
      axios.get("/getData").then((res) => {
        console.log(res);
      });
    }
    getTeams();
  }, []);

  return (
    <div>
      <h2>Let's get started!</h2>
      <select id="ft-year-select">
        <option default value="#">
          Select a Team
        </option>
      </select>
      <select id="ft-team-select">
        <option default value="#">
          Select a Team
        </option>
      </select>
      <h1>{state}</h1>
      <button onClick={clickHandeler}>Click Me</button>
    </div>
  );
};

export default App;
